%script

--  Find the importance of attributes that independently impact the target attribute:  BUY_INSURANCE

BEGIN DBMS_DATA_MINING.DROP_MODEL('AI_EXPLAIN_OUTPUT_BUY_INSURANCE_AI');
EXCEPTION WHEN OTHERS THEN NULL; END;

DECLARE
    V_SETLST DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    V_SETLST('ALGO_NAME')        := 'ALGO_AI_MDL';
    V_SETLST('PREP_AUTO')        := 'ON';

    DBMS_DATA_MINING.CREATE_MODEL2(
        MODEL_NAME        => 'AI_EXPLAIN_OUTPUT_BUY_INSURANCE_AI',
        MINING_FUNCTION   => 'ATTRIBUTE_IMPORTANCE',
        DATA_QUERY        => 'SELECT * FROM CUST_INSUR_LTV',
        SET_LIST          => V_SETLST,
        CASE_ID_COLUMN_NAME => 'CUST_ID',
        TARGET_COLUMN_NAME  => 'BUY_INSURANCE');
END;

-- %script

-- -- Split the data into random samples of 60% for training data (BUY_INSURANCE_TRAIN_DATA) for training the models and a 40% hold out sample for testing and evaluating the models (BUY_INSURANCE_TEST_DATA)

-- CREATE OR REPLACE VIEW BUY_INSURANCE_TRAIN_DATA AS SELECT * FROM CUST_INSUR_LTV SAMPLE (60) SEED (1);
-- CREATE OR REPLACE VIEW BUY_INSURANCE_TEST_DATA AS SELECT * FROM CUST_INSUR_LTV MINUS SELECT * FROM BUY_INSURANCE_TRAIN_DATA;

%script

-- Build a classification model and then generate a lift test result and an apply result.  

BEGIN
DBMS_DATA_MINING.DROP_MODEL('BUY_INSURANCE_CLASS_MODEL_NB');
EXCEPTION WHEN OTHERS THEN NULL; 
END;

DECLARE
    V_SETLST DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    V_SETLST('PREP_AUTO') := 'ON';
    V_SETLST('ALGO_NAME') := 'ALGO_NAIVE_BAYES';
    DBMS_DATA_MINING.CREATE_MODEL2(
        'BUY_INSURANCE_CLASS_MODEL_NB',
        'CLASSIFICATION',
        'SELECT * FROM BUY_INSURANCE_TRAIN_DATA_V',
        V_SETLST,
        'CUST_ID',
        'BUY_INSURANCE');
END;

