%script

-- Drop apply result table
DROP TABLE BUY_INSURANCE_APPLY_RESULT_NB PURGE;
DROP TABLE BUY_INSURANCE_LIFT_TABLE_NB PURGE;

-- Score the data and compute lift
BEGIN
DBMS_DATA_MINING.APPLY('BUY_INSURANCE_CLASS_MODEL_NB','BUY_INSURANCE_TEST_DATA_V','CUST_ID','BUY_INSURANCE_APPLY_RESULT_NB');
DBMS_DATA_MINING.COMPUTE_LIFT('BUY_INSURANCE_APPLY_RESULT_NB','BUY_INSURANCE_TEST_DATA_V','CUST_ID','BUY_INSURANCE','BUY_INSURANCE_LIFT_TABLE_NB','Yes','PREDICTION','PROBABILITY',100);
END;

