%script

DROP TABLE ALL_LIFT_DATA PURGE;

CREATE TABLE ALL_LIFT_DATA (ALGO_NAME VARCHAR2(50), QUANTILE_NUMBER NUMBER, GAIN_CUMULATIVE NUMBER);
INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_NAIVE_BAYES' AS VARCHAR(50)) AS ALGO_NAME FROM BUY_INSURANCE_LIFT_TABLE_NB;
INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_SUPPORT_VECTOR_MACHINES' AS VARCHAR(50)) AS ALGO_NAME FROM BUY_INSURANCE_LIFT_TABLE_SVM;
INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_RANDOM_FOREST' AS VARCHAR(50)) AS ALGO_NAME FROM BUY_INSURANCE_LIFT_TABLE_RF;
INSERT INTO ALL_LIFT_DATA (QUANTILE_NUMBER, GAIN_CUMULATIVE, ALGO_NAME) SELECT QUANTILE_NUMBER, GAIN_CUMULATIVE, CAST('ALGO_GENERALIZED_LINEAR_MODEL' AS VARCHAR(50)) AS ALGO_NAME FROM BUY_INSURANCE_LIFT_TABLE_GLM;

%script

-- Drops any existing WinePredictions table and creates a new one. 

DECLARE
V_SQL VARCHAR2(100);

BEGIN
V_SQL := 'DROP TABLE CUST_INSUR_PREDICTIONS PURGE';
EXECUTE IMMEDIATE V_SQL;
DBMS_OUTPUT.PUT_LINE (V_SQL ||': SUCCEEDED');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (V_SQL ||': DROP UNNECCESSARY - NO TABLE EXISTS');
END;
